import logo from './logo.svg';
import './App.css';
import Nav from './components/Nav';
import Cards from './components/Cards';
import Bio from './components/Bio';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <Header></Header>
      <Cards></Cards>
      <Bio></Bio>
      <Footer></Footer>
    </div>
  );
}

export default App;
